import React, { Component } from 'react';
import './App.css';
class App extends Component {
  state = {
    resultCount: 0
  };
  searchZillow = async (event) => {
    event.preventDefault();
    let response = await fetch('/zillow');
    let body = await response.json();
    this.setState({ resultCount: body.searchList.totalResultCount });
  }
  openCity(evt, cityName) {
    var i, tabcontent, tablinks;
    tabcontent = document.getElementsByClassName("tabcontent");
    for (i = 0; i < tabcontent.length; i++) {
      tabcontent[i].style.display = "none";
    }
    tablinks = document.getElementsByClassName("tablinks");
    for (i = 0; i < tablinks.length; i++) {
      tablinks[i].className = tablinks[i].className.replace(" active", "");
    }
    document.getElementById(cityName).style.display = "block";
    evt.currentTarget.className += " active";
  }
  render() {
    return (
<div className="App">
<header className="App-header">
<div class="tab">
  <button class="tablinks" onclick="openCity(event, 'London')">London</button>
  <button class="tablinks" onclick="openCity(event, 'Ireland')">Paris</button>
  <button class="tablinks" onclick="openCity(event, 'Tokyo')">Tokyo</button>
</div>
<div class="tab">
  <button class="tablinks" onclick="openCity(event, 'London')">London</button>
  <button class="tablinks" onclick="openCity(event, 'Paris')">Paris</button>
  <button class="tablinks" onclick="openCity(event, 'Tokyo')">Tokyo</button>
</div>
            <button onClick={(event)=>this.searchZillow(event)}>US Results</button>
<h2>Properties Found {this.state.resultCount}</h2>
        </header>
    </div>
    );
  }
}
export default App;
